description:
Last couple of years changed everything about workplace collaboration. For better or worse, millions of knowledge workers around the globe said adios to their office cubicles and embraced work-from-home / work-from-anywhere culture. This wave brought a whole new set of challenges & opportunities to team collaboration, knowledge sharing & project management.

Skills & Experience:
➔ Relevant professional experience (0.5+ year) with front-end technologies, - React, Node.js, Typescript. Whereas we appreciate some breadth, we value the depth even more!
➔ Attention to detail, passion for UX;
➔ Willingness to learn and use multiple technologies;
➔ Truly engineering approach to solving problems. Good theoretical foundations of computer science(e.g. algorithms and computational complexity, OOP) are super practical in the ever-changing landscape of technologies;
➔ Basic understanding of the architecture of web applications;
➔ Command of English at level B2 or higher;
➔ Contributions to any open source projects are a big advantage.

We are looking for a Senior Full-stack (Python/React) Developer with solid knowledge in Python, Typescript, and React to join our project with General Catalyst, a renowned venture capital firm based in the US, and take part in the solution architecture processes.

Skills & Experience:
➔ 4+ years of experience in the full software development life-cycle and knowledge of Python, Typescript, and React;
➔ Proficiency with Python;
➔ Experience with modern JavaScript frameworks;
➔ Experience with relational and distributed databases (including internals, e.g., PostgreSQL, MySQL, Cassandra, etc.);
➔ Proven ability for high-quality delivery;
➔ Strong interest in new technologies and willingness to learn them;
➔ Experienced with GCP Cloud technologies; 
➔ Experience in the implementation of REST API;
➔ Experience in writing tests (the whole test pyramid: unit/integration/end-to-end);
➔ Full-stack development experience on high-scale systems;
➔ Solid Computer Science background;
➔ Product-focused team player mindset.
